import React from "react";
import { useParams, Link, Outlet, useLocation } from "react-router-dom";

function Sucess() {

  const params = useParams();
  const user = params.movie;
   const location = useLocation();

   const cost = location.state.totalcost;
  const count = location.state.counts;
  return (
    <>
   
      <h4 class="success-page">
        {count} tickets are booked for {user} Movie at a cost of {cost}
      </h4>
      
      <div class="success-feedback">
        <Link to="/city">
          <button class="btn btn-primary w-10 py-2">Skip</button>
        </Link>

        <Link to="feedback">
          <button class="btn btn-primary w-10 py-2">Feedback</button>
        </Link>
      </div>
      <Outlet />
    </>
  );
}
export default Sucess;
